private MasterKey getMasterKey(String dbKey) throws IOException {
  try{
    byte[] data = db.get(bytes(dbKey));
    if (data == null || data.length == 0) {
      return null;
    }
    return parseMasterKey(data);
  } catch (DBException e) {
    throw new IOException(e);
  }
}
